import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const MainPage = () => {
  const navigate = useNavigate();

  const handleLogout = async () => {
    try {
      const response = await axios.post('http://localhost:3001/logout', {}, { withCredentials: true });
      if (response && response.data) {
        localStorage.removeItem('token');
        navigate('/login', { replace: true });
        window.location.reload();
      }
    } catch (error) {
      console.error('Error logging out', error);
    }
  };

  const handleMyVillas = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/villa/user-villas', { withCredentials: true });
      if (response && response.data) {
        navigate('/my-villas', { state: { villas: response.data } });
      }
    } catch (error) {
      console.error('Error fetching villas', error);
    }
  };

  return (
    <div>
      <h2>Main Page</h2>
      <button onClick={handleLogout}>Logout</button>
      <button onClick={handleMyVillas}>내 빌라</button>
      <button onClick={() => navigate('/register-villa')}>빌라 등록</button>
    </div>
  );
};

export default MainPage;
